import React from 'react';
import AfficheFill from './components/AfficheFill';
export default function App(){
  const filliers=[
    {codeF:12,nomF:'TDI'},
    {codeF:13,nomF:'Reseaux'},
    {codeF:14,nomF:'commerce'}
  ]

  return(
    <div>
      <AfficheFill filliers={filliers[0]}/>
      <hr/>
      <AfficheFill filliers={filliers[1]}/>
      <hr/>
      <AfficheFill filliers={filliers[2]}/>
    </div>
  )
}
